import React from "react";
import Header from "../components/Home/Header";
import Eventscon from "../components/Events/Eventscon";
import Footer from "../components/Home/Footers";

const Events = () => {
  return (
    <div className="App1">
      <Header />
      <Eventscon />
      <Footer />
    </div>
  );
};

export default Events;
